  \"narrative-report-crescent-lake-national-wildlife-refuge-period-ending-august-31-1952\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from May through August
  of 1952. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, raptors, fish, and disease- is also
  covered. The Refuge development and maintenance section discusses physical developments,
  plantings, and wildfires. Resource management is outlined; topics include grazing
  and haying. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, and Refuge participation. Items of interest, N-R forms, and photographs
  are attached.  A short narrative report of North Platte National Wildlife Refuge
  is included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
